import { Route } from 'react-router-dom';
import { Switch, Redirect } from 'react-router';


const App = () => {
    return (
      <div className={styles.wrapper}>
        <div className={styles.content}>
          <Switch>
            <Route path="/">
              <Dashboard />
            </Route>
            {/* <Route exact path="/">
              <Home />
            </Route> */}
          </Switch>
        </div>
      </div>
    );
 }

export default App;
